import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { auth } from '../firebase';
import styled from 'styled-components';

const Exercise = () => {
  const navigate = useNavigate();
  const [userData, setUserData] = useState(null);
  const [selectedSplit, setSelectedSplit] = useState("");
  const [workoutPlan, setWorkoutPlan] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        if (!auth.currentUser) {
          console.warn("‚ö†Ô∏è No authenticated user found. Redirecting...");
          navigate('/');
          return;
        }

        const idToken = await auth.currentUser.getIdToken();
        const API_URL = "http://localhost:5000";

        const response = await fetch(`${API_URL}/api/auth/me`, {
          headers: {
            'Authorization': `Bearer ${idToken}`
          }
        });

        if (response.ok) {
          const userData = await response.json();
          setUserData(userData);
        } else {
          console.error("‚ùå Failed to fetch user data, redirecting to login...");
          navigate('/');
        }
      } catch (error) {
        console.error('üö® Error fetching user data:', error);
        navigate('/');
      } finally {
        setLoading(false);
      }
    };

    fetchUserData();
  }, [navigate]);

  const fetchWorkoutPlan = async () => {
    if (!selectedSplit) {
      alert("Please select a workout split.");
      return;
    }

    try {
      const API_URL = "http://localhost:5000";
      console.log(`üì° Fetching workout plan from: ${API_URL}/api/full_recommendation?split_type=${selectedSplit}`);

      const response = await fetch(`${API_URL}/api/full_recommendation?split_type=${selectedSplit}`, {
        method: "GET",
        headers: {
          "Content-Type": "application/json"
        }
      });

      if (!response.ok) {
        const errorText = await response.text();
        console.error(`‚ùå Failed to fetch workout plan. Server response: ${errorText}`);
        throw new Error(`Failed to fetch workout plan: ${errorText}`);
      }

      const data = await response.json();
      console.log("‚úÖ Workout plan received:", data);

      setWorkoutPlan(data.workout_plan || {}); 
    } catch (error) {
      console.error("üö® Error fetching workout plan:", error.message);
    }
  };

  if (loading) return <p>Loading user data...</p>;

  return (
    <div>
      <h2>Create Your Workout Plan</h2>
      <label>Select Workout Split:</label>
      <select value={selectedSplit} onChange={(e) => setSelectedSplit(e.target.value)}>
        <option value="">Select Split</option>
        <option value="total_body">Total Body Split</option>
        <option value="upper_lower">Upper vs. Lower Split</option>
        <option value="push_pull_legs">Push vs. Pull vs. Legs Split</option>
        <option value="bro_split">Bro Split</option>
      </select>
      <button onClick={fetchWorkoutPlan}>Generate Plan</button>

      {workoutPlan && Object.keys(workoutPlan).length > 0 ? (
        <WorkoutPlanContainer>
          <h3>Your Workout Plan:</h3>
          {Object.entries(workoutPlan).map(([category, exercises]) => (
            <WorkoutCategory key={category}>
              <h4>{category.toUpperCase()}</h4>
              <ExerciseGrid>
                {exercises.map((exercise, index) => (
                  <ExerciseCard key={index}>{exercise}</ExerciseCard>
                ))}
              </ExerciseGrid>
            </WorkoutCategory>
          ))}
        </WorkoutPlanContainer>
      ) : (
        <p>No workout plan available yet. Please generate one.</p>
      )}
    </div>
  );
};

export default Exercise;

/* --- STYLES --- */

const WorkoutPlanContainer = styled.div`
  margin-top: 20px;
  padding: 20px;
  background-color: rgba(255, 255, 255, 0.1);
  border-radius: 10px;
  box-shadow: 0 0 10px rgba(255, 255, 255, 0.2);
  display: flex;
  flex-direction: column;
  align-items: center;
  width: 80%;
  max-width: 1000px;
`;

const WorkoutCategory = styled.div`
  margin-bottom: 20px;
  width: 100%;
  text-align: center;

  h4 {
    font-size: 24px;
    margin-bottom: 10px;
    text-transform: uppercase;
    color: #fff;
  }
`;

/* ‚úÖ Creates a Grid Layout for Exercises */
const ExerciseGrid = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  gap: 15px;
`;

/* ‚úÖ Individual Exercise Cards */
const ExerciseCard = styled.div`
  background: rgba(255, 255, 255, 0.2);
  padding: 10px;
  border-radius: 8px;
  min-width: 200px;
  text-align: center;
  font-size: 18px;
  color: white;
  font-weight: bold;
  box-shadow: 0 4px 8px rgba(255, 255, 255, 0.2);
`;
